Template.playlistItem.onRendered(function() {
  Meteor.subscribe('one-track', this.data.trackId);
})

Template.playlistItem.helpers({
  track: function() {
    return Tracks.findOne(Template.instance().data.trackId)
  }
})

Template.playlistItem.events({
  'click .delete-pli': function(e, t) {
    e.preventDefault();
    e.stopPropagation();
    console.log(e);
    var pliId = t.data._id;
    var playlist = $(e.currentTarget).parents('li.playlist-item-wrapper').data('playlist');
    //console.log();
    var confirmed = confirm("Delete track from playlist?");

    if(confirmed && playlist == 'MyPlaylistItems') {
      MyPlaylistItems.remove({
        _id: pliId
      });
    } else if(confirmed && playlist == 'SingerPlaylistItems') {
      SingerPlaylistItems.remove({
        _id: pliId
      });
    } else if(confirmed && playlist == 'SongPlaylistItems') {
      SongPlaylistItems.remove({
        _id: pliId
      });
    }
  }
})

